def qwen_detect(content,image):
    data = {
        "model": "qwen-vl",
        "stream": False,
        "messages": [
            {
                "role": "system",
                "content": content
            },
            {
                "role": "user",
                "content": [
                    {
                        "type": "image_url",
                        "image_url": {
                            "url": "data:image/jpeg;base64,"+str(image)
                        }
                    }
                ]
            }
        ]
    }
    # 设置请求头，包括Authorization头
    headers = {
        'Authorization': f'Bearer {token}',
        'Content-Type': 'application/json'  # 如果数据是JSON格式，需要设置这个头
    }

    # 发送POST请求
    response = requests.post(url, headers=headers, data=json.dumps(data))

    # 检查响应状态码
    if response.status_code == 200:
        # 请求成功，处理响应数据
        print('Request successful!')
        response_result=response.json()
        qwen_detect_result=response_result['choices'][0]['message']['content']
        print(response_result)

        if qwen_detect_result == 'True' or "True" in qwen_detect_result:
            return 1
        else:
            return 0
    else:
        # 请求失败，打印错误信息
        print(f'Request failed with status code: {response.status_code}')
        print(response.text)  # 打印响应的文本内容
        return 2
